import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity, SafeAreaView } from 'react-native';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import SearchBar from '../bottom-nav-bar/SearchBar';

const ICON_SIZE = 48;

const icons = [
  { name: 'pizza', label: 'Pizza' },
  { name: 'hamburger', label: 'Burger' },
  { name: 'food-halal', label: 'Halal' },
  { name: 'cake', label: 'Cake' },
  { name: 'cookie', label: 'Cookie' },
  { name: 'ice-cream', label: 'Ice Cream' },
  { name: 'coffee', label: 'Coffee' },
  { name: 'beer', label: 'Beer' },
  { name: 'food-apple', label: 'Apple' },
  { name: 'food-turkey', label: 'Turkey' },
  { name: 'food-kosher', label: 'Kosher' },
  { name: 'food-steak', label: 'Steak' },
];

const rectangleIcons = [
  { name: 'home-outline', label: 'Home' },
  { name: 'account-outline', label: 'Account' },
  { name: 'bell-outline', label: 'Notifications' },
  { name: 'calendar-month-outline', label: 'Calendar' },
  { name: 'cash-multiple-outline', label: 'Payments' },
  { name: 'car-outline', label: 'Rides' },
  { name: 'chat-outline', label: 'Chat' },
  { name: 'home-outline', label: 'Home' },
];


const ExploreScreen = () => {
  const rows = Math.floor(icons.length / 4);
  const lastRowIconsCount = icons.length % 4;

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.headerContainer}>
        <Text style={styles.headerText}>Explore</Text>
      </View>
      <View style={styles.searchBarContainer}>
        <SearchBar />
      </View>
      <View style={styles.contentContainer}>
        <View style={styles.grid}>
          {[...Array(rows)].map((_, rowIndex) => (
            <View key={rowIndex} style={styles.row}>
              {[...Array(4)].map((_, colIndex) => {
                const iconIndex = rowIndex * 4 + colIndex;
                const icon = icons[iconIndex];
                return (
                  <TouchableOpacity key={icon.name} style={styles.iconContainer}>
                    <View style={styles.iconBackground}>
                      <MaterialCommunityIcons name={icon.name} size={ICON_SIZE} color="#ff82b2" />
                    </View>
                    <Text style={styles.iconLabel}>{icon.label}</Text>
                  </TouchableOpacity>
                );
              })}
            </View>
          ))}
          {lastRowIconsCount > 0 && (
            <View style={styles.row}>
              {[...Array(lastRowIconsCount)].map((_, colIndex) => {
                const iconIndex = icons.length - lastRowIconsCount + colIndex;
                const icon = icons[iconIndex];
                return (
                  <TouchableOpacity key={icon.name} style={styles.iconContainer}>
                    <View style={styles.iconBackground}>
                      <MaterialCommunityIcons name={icon.name} size={ICON_SIZE} color="#ff82b2" />
                    </View>
                    <Text style={styles.iconLabel}>{icon.label}</Text>
                  </TouchableOpacity>
                );
              })}
            </View>
          )}
        <View style={styles.browseHeader}>
          <Text style={styles.browseHeaderText}>Halal food near me</Text>
        </View>

        </View>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#bbd1ed',
  },
  headerContainer: {
    alignItems: 'flex-start',
    justifyContent: 'flex-start',
    marginTop: 0,
    marginLeft: 0,
  },
  headerText: {
    fontSize: 32,
    fontWeight: 'bold',
    color: 'black',
    marginBottom: 10,
    marginLeft: -170, // Add this line to move the text to the left
  },
  searchBarContainer: {
    marginTop: 20,
    marginBottom: 10,
    alignItems: 'center',
    justifyContent: 'center',
  },
  contentContainer: {
    flex: 10,
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
  },
  grid: {
    flexDirection: 'column',
    justifyContent: 'flex-start',
    alignItems: 'center',
    marginTop: -340,
    },
    row: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    width: '100%',
    marginBottom: 6,
    },
    iconContainer: {
    justifyContent: 'center',
    alignItems: 'center',
    width: ICON_SIZE + 20,
    height: ICON_SIZE + 28,
    margin: 1.4,
    },
    iconBackground: {
    width: ICON_SIZE + 20,
    height: ICON_SIZE + 8,
    backgroundColor: '#d3c5fa',
    borderRadius: 18,
    justifyContent: 'center',
    alignItems: 'center',
    },
    iconLabel: {
    fontSize: 10,
    fontWeight: 'bold',
    color: '#5a5e56',
    marginTop: 4,
    },
    browseHeader: {
      marginTop: 20,
      marginBottom: 10,
      alignItems: 'center',
      justifyContent: 'center',
    },
    browseHeaderText: {
      fontSize: 24,
      fontWeight: 'bold',
      color: 'black',
      marginLeft: -140,
    },
    });
    export default ExploreScreen;
